fun ShareEntity.toVO(): Share {
    val onNull = "unknown"
    return Share(
        this.song?.toVO() ?: Song(onNull,onNull,Uri.EMPTY,Uri.EMPTY),
        this.message ?: onNull,
        this.sentUser?.toVO() ?: User(onNull,Uri.EMPTY),
        this.isLike ?: false
    )
}

fun SongEntity.toVO(): Song {
    val onNull = "unknown"
    return Song(
        this.title ?: onNull,
        this.artist ?: onNull,
        this.preview ?: Uri.EMPTY,
        this.coverImage ?: Uri.EMPTY

    )
}

fun UserEntity.toVO(): User {
    val onNull = "unknown"
    return User(
        this.nickname ?: onNull,
        this.image ?: Uri.EMPTY
    )
}

